import React, {useState} from "react";

const ProjectData = React.createContext({
    Cart: []
})

export function DataProvider () {
    const [CartArray, setCartArray] = useState([]);

    return (
        <ProjectData.Provider
            value={{
                Cart: []
            }}
        >
            {props.children}
        </ProjectData.Provider>
    );

};

export default ProjectData;
